ntNode.offsetHeight+\'px\');}*/\n.ui-jqgrid-dnd tr td {border-right-width: 1px; border-right-color: inherit; border-right-style: solid; height:20px}\n/* RTL Support */\n.ui-jqgrid .ui-jqgrid-caption-rtl {text-align: right;}\n.ui-jqgrid .ui-jqgrid-hbox-rtl {float: right;}\n.ui-jqgrid .ui-jqgrid-resize-ltr {float: right;margin: -2px -2px -2px 0;}\n.ui-jqgrid .ui-jqgrid-resize-rtl {float: left;margin: -2px 0 -1px -3px;}\n.ui-jqgrid .ui-sort-rtl {left:0;}\n.ui-jqgrid .tree-wrap-ltr {float: left;}\n.ui-jqgrid .tree-wrap-rtl {float: right;}\n.ui-jqgrid .ui-ellipsis {-moz-text-overflow:ellipsis;text-overflow:ellipsis;}\n\n/* Toolbar Search Menu , Nav menu*/\n.ui-search-menu, \n.ui-nav-menu {\n	position: absolute; \n	padding: 2px 5px; \n	z-index:99999;\n	-webkit-box-shadow: 7px 7px 5px 0px rgba(50, 50, 50, 0.75);\n	-moz-box-shadow:    7px 7px 5px 0px rgba(50, 50, 50, 0.75);\n	box-shadow:         7px 7px 5px 0px rgba(50, 50, 50, 0.75);\n}\n.ui-search-menu.ui-menu .ui-menu-item,\n.ui-nav-menu.ui-menu .ui-menu-item\n{ \n	list-style-image: none; \n	padding-right: 0; \n	padding-left: 0; \n}\n.ui-search-menu.ui-menu .ui-menu-item a, \n.ui-nav-menu.ui-menu .ui-menu-item a \n{ \n	display: block; \n}\n.ui-search-menu.ui-menu .ui-menu-item a.g-menu-item:hover,\n.ui-nav-menu.ui-menu .ui-menu-item a.g-menu-item:hover \n{ \n	margin: -1px; \n	font-weight: normal; \n}\n.ui-jqgrid .ui-search-table { padding: 0; border: 0 none; height:20px; width:100%;}\n.ui-jqgrid .ui-search-table .ui-search-oper { width:20px; }\na.g-menu-item, a.soptclass, a.clearsearchclass { cursor: pointer; } \n.ui-jqgrid .ui-jqgrid-view input,\n.ui-jqgrid .ui-jqgrid-view select,\n.ui-jqgrid .ui-jqgrid-view textarea,\n.ui-jqgrid .ui-jqgrid-view button {\n    font-size: inherit;\n}\n\n.ui-jqgrid .ui-scroll-popup {width: 95px;}\n.ui-search-table select,\n.ui-search-table input \n{\n	padding: 4px 3px;\n}\n\n.ui-jqgrid .ui-pg-table .ui-pg-button.ui-state-disabled:hover > .ui-separator {\n	margin-left: 3px;\n	margin-right: 3px;\n}\n\n.ui-jqgrid .ui-pg-table .ui-pg-button.ui-state-disabled:hover > .ui-pg-div > .ui-icon {\n	margin-left: 3px;\n	margin-right: 3px;\n}\n/* Column menu */\n.ui-jqgrid .ui-jqgrid-htable .colmenu {\n	position:absolute;\n	right:1px;\n	height:100%;\n	color : black;\n}\n.ui-jqgrid .ui-jqgrid-htable .colmenu-rtl {\n	right: auto;\n	left : 1px;\n	position:absolute;\n	height:100%;\n	color : black;\n}\n.ui-jqgrid .ui-jqgrid-htable .colmenuspan {\n	display:inline-block;\n}\n\n.ui-jqgrid .ui-jqgrid-htable .ui-th-div {\n	height:17px;\n	margin-top:5px;\n}\n.column-menu, .ui-search-menu {\n	padding: 10px 10px;\n}\n.column-menu .divider {\n	background-color: #e5e5e5; \n	height: 1px;\n	padding:0 0;\n	margin: 5px 0;  \n	overflow: hidden;\n}\n.ui-menu-item .ui-common-table .menu_icon {\n	white-space: pre;\n	padding-right: 4px;\n	padding-left: 4px;\n	width : auto;\n}\n.ui-menu-item .ui-common-table .menu_icon .ui-icon {\n	display : inline-block;\n	position: relative;\n}\ntd.menu_text {\n	width: auto;\n	white-space: nowrap;\n}\n.ui-search-menu .ui-menu-item {\n	padding : 0 0;\n}\n.ui-col-menu .ui-menu-item td.menu_text{\n	padding-top: 0;\n	padding-bottom: 0;\n	padding-left : 1px;\n}\n.ui-col-menu .ui-menu-item td.menu_icon{\n	padding-top: 0;\n	padding-bottom: 0;\n	vertical-align: middle;\n}\n.ui-col-menu .ui-menu-item td.menu_icon input{\n	margin: 2px 0;\n	\n}\n#search_menu .ui-menu-item div {\n	margin: 3px 0;\n	white-space: nowrap;\n}\n\n#search_menu .ui-menu-item div input,\n#search_menu .ui-menu-item div select\n{\n	padding: 3px 2px;\n}\n#search_menu  .search_buttons {\n	display:inline-block;\n	width:50%;\n}\n#column_menu.ui-menu .ui-menu-item {\n	position :static;\n}\n/*menubar*/\n.ui-jqgrid .ui-jqgrid-menubar {\n	margin: 0px 5px;\n	width:19px;\n	height:18px;\n}\n.ui-jqgrid .ui-jqgrid-menubar:hover {\n	border: 0 none;\n}\n.ui-jqgrid .menubar-rtl {\n	float : right;\n}\n\n.ui-jqgrid .menubar-ltr {\n	float : left;\n}\n/*printing*/\n\n.jqgridprint {\n	width : 100%;\n	font-size: 13px;\n}\n\n.jqgridprint th,\n.jqgridprint td {\n	padding: 4px 4px 4px 4px ;\n	text-align: center ;\n}\n.jqgridprint th {\n	border-bottom: 2px solid #333333 ;\n}\n.jqgridprint td {\n	border-bottom: 1px dotted #999999 ;\n}\n\n.jqgridprint tfoot td {\n	border-bottom-width: 0px ;\n	border-top: 2px solid #333333 ;\n	padding-top: 20px ;\n}\n\n.ui-jqgrid .jqgrid-caption-menu \n{ \n	left:0;\n	top:30px;\n	position:absolute;\n	display:none;\n	font-size: inherit;\n	width : auto;\n}\n.ui-jqgrid .jqgrid-column-menu\n{\n	font-size:inherit;\n	width:auto;\n	position: absolute;\n}\n'),(41,'URIPath','css','BOH',19,'learnity1_main.css','coreadmin/css/',NULL),(25,'URIPath','css','BOH',20,'ui.dynatree.css','../coreadmin/resource/dynatree/skin-vista/',NULL),(26,'URIPath','css','BOH',20,'ui.dynatree.css','coreadmin/resource/dynatree/skin-vista/',NULL),(37,'Dynamic','css','BOH',20,'ui.dynatree.css','',_binary '/*******************************************************************************\r\n * Tree container\r\n */\r\nul.dynatree-container\r\n{\r\n	font-family: tahoma, arial, helvetica;\r\n	font-size: 10pt; /* font size should not be too big */\r\n	white-space: nowrap;\r\n	padding: 3px;\r\n	margin: 0; /* issue 201 */\r\n	background-color: white;\r\n	border: 1px dotted gray;\r\n	overflow: auto;\r\n/*	height: 100%; /* issue 263, 470 */\r\n	min-height: 0%;\r\n}\r\n\r\nul.dynatree-container ul\r\n{\r\n	padding: 0 0 0 16px;\r\n	margin: 0;\r\n}\r\n\r\nul.dynatree-container li\r\n{\r\n	list-style-image: none;\r\n	list-style-position: outside;\r\n	list-style-type: none;\r\n	-moz-background-clip:border;\r\n	-moz-background-inline-policy: continuous;\r\n	-moz-background-origin: padding;\r\n	background-attachment: scroll;\r\n	background-color: transparent;\r\n	background-repeat: repeat-y;\r\n	background-image: url(\"vline.gif\");\r\n	background-position: 0 0;\r\n	/*\r\n	background-image: url(\"icons_96x256.gif\");\r\n	background-position: -80px -64px;\r\n	*/\r\n	margin: 0;\r\n	padding: 1px 0 0 0;\r\n}\r\n/* Suppress lines for last child node */\r\nul.dynatree-container li.dynatree-lastsib\r\n{\r\n	background-image: none;\r\n}\r\n/* Suppress lines if level is fixed expanded (option minExpandLevel) */\r\nul.dynatree-no-connector > li\r\n{\r\n	background-image: none;\r\n}\r\n\r\n/* Style, when control is disabled */\r\n.ui-dynatree-disabled ul.dynatree-container\r\n{\r\n	opacity: 0.5;\r\n/*	filter: alpha(opacity=50); /* Yields a css warning */\r\n	background-color: silver;\r\n}\r\n\r\n/*******************************************************************************\r\n * Common icon definitions\r\n */\r\nspan.dynatree-empty,\r\nspan.dynatree-vline,\r\nspan.dynatree-connector,\r\nspan.dynatree-expander,\r\nspan.dynatree-icon,\r\nspan.dynatree-checkbox,\r\nspan.dynatree-radio,\r\nspan.dynatree-drag-helper-img,\r\n#dynatree-drop-marker\r\n{\r\n	width: 16px;\r\n	height: 16px;\r\n/*	display: -moz-inline-box; /* @ FF 1+2 removed for issue 221 */\r\n/*	-moz-box-align: start; /* issue 221 */\r\n	display: inline-block; /* Required to make a span sizeable */\r\n	vertical-align: top;\r\n	background-repeat: no-repeat;\r\n	background-position: left;\r\n	background-image: url(\"icons.gif\");\r\n	background-position: 0 0;\r\n}\r\n\r\n/** Used by \'icon\' node option: */\r\nul.dynatree-container img\r\n{\r\n	width: 16px;\r\n	height: 16px;\r\n	margin-left: 3px;\r\n	vertical-align: top;\r\n	border-style: none;\r\n}\r\n\r\n\r\n/*******************************************************************************\r\n * Lines and connectors\r\n */\r\n\r\nspan.dynatree-connector\r\n{\r\n	background-position: -16px -64px;\r\n}\r\n\r\n/*******************************************************************************\r\n * Expander icon\r\n * Note: IE6 doesn\'t correctly evaluate multiples class names,\r\n *		 so we create combined class names that can be used in the CSS.\r\n *\r\n * Prefix: dynatree-exp-\r\n * 1st character: \'e\': expanded, \'c\': collapsed\r\n * 2nd character (optional): \'d\': lazy (Delayed)\r\n * 3rd character (optional): \'l\': Last sibling\r\n */\r\n\r\nspan.dynatree-expander\r\n{\r\n	background-position: 0px -80px;\r\n	cursor: pointer;\r\n}\r\n.dynatree-exp-cl span.dynatree-expander /* Collapsed, not delayed, last sibling */\r\n{\r\n	background-position: 0px -96px;\r\n}\r\n.dynatree-exp-cd span.dynatree-expander /* Collapsed, delayed, not last sibling */\r\n{\r\n	background-position: -64px -80px;\r\n}\r\n.dynatree-exp-cdl span.dynatree-expander /* Collapsed, delayed, last sibling */\r\n{\r\n	background-position: -64px -96px;\r\n}\r\n.dynatree-exp-e span.dynatree-expander,  /* Expanded, not delayed, not last sibling */\r\n.dynatree-exp-ed span.dynatree-expander  /* Expanded, delayed, not last sibling */\r\n{\r\n	background-position: -32px -80px;\r\n}\r\n.dynatree-exp-el span.dynatree-expander,  /* Expanded, not delayed, last sibling */\r\n.dynatree-exp-edl span.dynatree-expander  /* Expanded, delayed, last sibling */\r\n{\r\n	background-position: -32px -96px;\r\n}\r\n.dynatree-loading span.dynatree-expander  /* \'Loading\' status overrides all others */\r\n{\r\n	background-position: 0 0;\r\n	background-image: url(\"loading.gif\");\r\n}\r\n\r\n\r\n/*******************************************************************************\r\n * Checkbox icon\r\n */\r\nspan.dynatree-checkbox\r\n{\r\n	margin-left: 3px;\r\n	background-position: 0px -32px;\r\n}\r\nspan.dynatree-checkbox:hover\r\n{\r\n	background-position: -16px -32px;\r\n}\r\n\r\n.dynatree-partsel span.dynatree-checkbox\r\n{\r\n	background-position: -64px -32px;\r\n}\r\n.dynatree-partsel span.dynatree-checkbox:hover\r\n{\r\n	background-position: -80px -32px;\r\n}\r\n\r\n.dynatree-selected span.dynatree-checkbox\r\n{\r\n	background-position: -32px -32px;\r\n}\r\n.dynatree-selected span.dynatree-checkbox:hover\r\n{\r\n	background-position: -48px -32px;\r\n}\r\n\r\n/*******************************************************************************\r\n * Radiobutton icon\r\n * This is a customization, that may be activated by overriding the \'checkbox\'\r\n * class name as \'dynatree-radio\' in the tree options.\r\n */\r\nspan.dynatree-radio\r\n{\r\n	margin-left: 3px;\r\n	background-position: 0px -48px;\r\n}\r\nspan.dynatree-radio:hover\r\n{\r\n	background-position: -16px -48px;\r\n}\r\n\r\n.dynatree-partsel span.dynatree-radio\r\n{\r\n	background-position: -64px -48px;\r\n}\r\n.dynatree-partsel span.dynatree-radio:hover\r\n{\r\n	background-position: -80px -48px;\r\n}\r\n\r\n.dynatree-selected span.dynatree-radio\r\n{\r\n	background-position: -32px -48px;\r\n}\r\n.dynatree-selected span.dynatree-radio:hover\r\n{\r\n	background-position: -48px -48px;\r\n}\r\n\r\n/*******************************************************************************\r\n * Node type icon\r\n * Note: IE6 doesn\'t correctly evaluate multiples class names,\r\n *		 so we create combined class names that can be used in the CSS.\r\n *\r\n * Prefix: dynatree-ico-\r\n * 1st character: \'e\': expanded, \'c\': collapsed\r\n * 2nd character (optional): \'f\': folder\r\n */\r\n\r\nspan.dynatree-icon /* Default icon */\r\n{\r\n	margin-left: 3px;\r\n	background-position: 0px 0px;\r\n}\r\n\r\n.dynatree-ico-cf span.dynatree-icon  /* Collapsed Folder */\r\n{\r\n	background-position: 0px -16px;\r\n}\r\n\r\n.dynatree-ico-ef span.dynatree-icon  /* Expanded Folder */\r\n{\r\n	background-position: -64px -16px;\r\n}\r\n\r\n/* Status node icons */\r\n\r\n.dynatree-statusnode-wait span.dynatree-icon\r\n{\r\n	background-image: url(\"loading.gif\");\r\n}\r\n\r\n.dynatree-statusnode-error span.dynatree-icon\r\n{\r\n	background-position: 0px -112px;\r\n/*	background-image: url(\"ltError.gif\");*/\r\n}\r\n\r\n/*******************************************************************************\r\n * Node titles\r\n */\r\n\r\n/* @Chrome: otherwise hit area of node titles is broken (issue 133)\r\n   Removed again for issue 165; (133 couldn\'t be reproduced) */\r\nspan.dynatree-node\r\n{\r\n/*	display: -moz-inline-box; /* issue 133, 165, 172, 192. removed for issue 221*/\r\n/*	-moz-box-align: start; /* issue 221 */\r\n	display: inline-block; /* issue 373 Required to make a span sizeable */\r\n	vertical-align: top;\r\n}\r\n\r\n\r\n/* Remove blue color and underline from title links */\r\nul.dynatree-container a\r\n/*, ul.dynatree-container a:visited*/\r\n{\r\n	color: black; /* inherit doesn\'t work on IE */\r\n	text-decoration: none;\r\n	vertical-align: top;\r\n	margin: 0px;\r\n	margin-left: 3px;\r\n/*	outline: 0; /* @ Firefox, prevent dotted border after click */\r\n}\r\n\r\nul.dynatree-container a:hover\r\n{\r\n/*	text-decoration: underline; */\r\n	background-color: #F2F7FD; /* light blue */\r\n	border-color: #B8D6FB; /* darker light blue */\r\n}\r\n\r\nspan.dynatree-node a\r\n{\r\n	font-size: 10pt; /* required for IE, quirks mode */\r\n	display: inline-block; /* Better alignment, when title contains <br> */\r\n/*	vertical-align: top;*/\r\n	padding-left: 3px;\r\n	padding-right: 3px; /* Otherwise italic font will be outside bounds */\r\n	/*	line-height: 16px; /* should be the same as img height, in case 16 px */\r\n}\r\nspan.dynatree-folder a\r\n{\r\n	font-weight: bold;\r\n}\r\n\r\nul.dynatree-container a:focus,\r\nspan.dynatree-focused a:link  /* @IE */\r\n{\r\n	background-color: #EFEBDE; /* gray */\r\n}\r\n\r\nspan.dynatree-has-children a\r\n{\r\n}\r\n\r\nspan.dynatree-expanded a\r\n{\r\n}\r\n\r\nspan.dynatree-selected a\r\n{\r\n	color: green;\r\n	font-style: italic;\r\n}\r\n\r\nspan.dynatree-active a\r\n{\r\n	background-color: #3169C6 !important;\r\n	color: white !important; /* @ IE6 */\r\n}\r\n\r\n/*******************************************************************************\r\n * Drag\'n\'drop support\r\n */\r\n\r\n/*** Helper object ************************************************************/\r\ndiv.dynatree-drag-helper\r\n{\r\n}\r\ndiv.dynatree-drag-helper a\r\n{\r\n	border: 1px solid gray;\r\n	background-color: white;\r\n	padding-left: 5px;\r\n	padding-right: 5px;\r\n	opacity: 0.8;\r\n}\r\nspan.dynatree-drag-helper-img\r\n{\r\n	/*\r\n	position: relative;\r\n	left: -16px;\r\n	*/\r\n}\r\ndiv.dynatree-drag-helper /*.dynatree-drop-accept*/\r\n{\r\n\r\n/*    border-color: green;\r\n	background-color: red;*/\r\n}\r\ndiv.dynatree-drop-accept span.dynatree-drag-helper-img\r\n{\r\n	background-position: -32px -112px;\r\n}\r\ndiv.dynatree-drag-helper.dynatree-drop-reject\r\n{\r\n	border-color: red;\r\n}\r\ndiv.dynatree-drop-reject span.dynatree-drag-helper-img\r\n{\r\n	background-position: -16px -112px;\r\n}\r\n\r\n/*** Drop marker icon *********************************************************/\r\n\r\n#dynatree-drop-marker\r\n{\r\n	width: 24px;\r\n	position: absolute;\r\n	background-position: 0 -128px;\r\n	margin: 0;\r\n/*	border: 1px solid red; */\r\n}\r\n#dynatree-drop-marker.dynatree-drop-after,\r\n#dynatree-drop-marker.dynatree-drop-before\r\n{\r\n	width:64px;\r\n	background-position: 0 -144px;\r\n}\r\n#dynatree-drop-marker.dynatree-drop-copy\r\n{\r\n	background-position: -64px -128px;\r\n}\r\n#dynatree-drop-marker.dynatree-drop-move\r\n{\r\n	background-position: -64px -128px;\r\n}\r\n\r\n/*** Source node while dragging ***********************************************/\r\n\r\nspan.dynatree-drag-source\r\n{\r\n	/* border: 1px dotted gray; */\r\n	background-color: #e0e0e0;\r\n}\r\nspan.dynatree-drag-source a\r\n{\r\n	color: gray;\r\n}\r\n\r\n/*** Target node while dragging cursor is over it *****************************/\r\n\r\nspan.dynatree-drop-target\r\n{\r\n	/*border: 1px solid gray;*/\r\n}\r\nspan.dynatree-drop-target a\r\n{\r\n}\r\nspan.dynatree-drop-target.dynatree-drop-accept a\r\n{\r\n	/*border: 1px solid green;*/\r\n	background-color: #3169C6 !important;\r\n	color: white !important; /* @ IE6 */\r\n	text-decoration: none;\r\n}\r\nspan.dynatree-drop-target.dynatree-drop-reject\r\n{\r\n	/*border: 1px solid red;*/\r\n}\r\nspan.dynatree-drop-target.dynatree-drop-after a\r\n{\r\n}\r\n\r\n\r\n/**************************************