olute; left: 2px; }\r\n.ui-multiselect li a.action { position: absolute; right: 2px; top: 2px; }\r\n \r\n.ui-multiselect input.search { height: 14px; padding: 1px; opacity: 0.5; margin: 4px; width: 100px; }'),(41,'URIPath','css','BOH',20,'ui.dynatree.css','coreadmin/template_assets/',NULL),(25,'URIPath','css','BOH',21,'main2.css','../coreadmin/css/',NULL),(26,'URIPath','css','BOH',21,'main2.css','coreadmin/css/',NULL),(37,'URIPath','css','BOH',21,'main2.css','coreadmin/css/',NULL),(40,'URIPath','css','BOH',21,'learnity1_main.css','coreadmin/css/',NULL),(41,'URIPath','css','BOH',21,'main2.css','coreadmin/css/',NULL),(25,'URIPath','css','BOH',22,'ui.multiselect.css','../coreadmin/resource/jQgrid_plugins/',NULL),(26,'URIPath','css','BOH',22,'ui.multiselect.css','coreadmin/resource/jQgrid_plugins/',NULL),(40,'Dynamic','css','BOH',22,'ui.dynatree.css','',_binary '/*******************************************************************************\r\n * Tree container\r\n */\r\nul.dynatree-container\r\n{\r\n	font-family: tahoma, arial, helvetica;\r\n	font-size: 10pt; /* font size should not be too big */\r\n	white-space: nowrap;\r\n	padding: 3px;\r\n	margin: 0; /* issue 201 */\r\n	background-color: white;\r\n	border: 1px dotted gray;\r\n	overflow: auto;\r\n/*	height: 100%; /* issue 263, 470 */\r\n	min-height: 0%;\r\n}\r\n\r\nul.dynatree-container ul\r\n{\r\n	padding: 0 0 0 16px;\r\n	margin: 0;\r\n}\r\n\r\nul.dynatree-container li\r\n{\r\n	list-style-image: none;\r\n	list-style-position: outside;\r\n	list-style-type: none;\r\n	-moz-background-clip:border;\r\n	-moz-background-inline-policy: continuous;\r\n	-moz-background-origin: padding;\r\n	background-attachment: scroll;\r\n	background-color: transparent;\r\n	background-repeat: repeat-y;\r\n	background-image: url(\"vline.gif\");\r\n	background-position: 0 0;\r\n	/*\r\n	background-image: url(\"icons_96x256.gif\");\r\n	background-position: -80px -64px;\r\n	*/\r\n	margin: 0;\r\n	padding: 1px 0 0 0;\r\n}\r\n/* Suppress lines for 